import React from 'react'

const Listusers = ({ props }) => {
    return (
      <div className="centrado">
        <h1 className="title bla">Usuarios logueados</h1>
        {props.map((user, i) => {
          return (
            <div  className="fav "key={i}>
            <ul>
              <li>
                <h2 className="listUser ">{user.name}</h2>
              </li>
            </ul>
            </div>
          );
        })}
      </div>
    );
  };
export default Listusers

